function Base64() {
    ClearArray();
    var input = document.querySelector("input[type=file]");
    var file = input.files[0],
    reader = new FileReader();
    
    var fileInput = document.getElementById("upLoad");
    var filePath = fileInput.value;

    if(jpg.exec(filePath)){
    
        b64dataType = 'data:image/jpg;base64,';
    
    } 
    else if(jpeg.exec(filePath)){
        b64dataType = 'data:image/jpeg;base64,';
        
    }
    else if(png.exec(filePath)){
        b64dataType = 'data:image/png;base64,';
        
    }
    else if(gif.exec(filePath)){
        b64dataType = 'data:image/gif;base64,';
        
    }
    else{
        alert('Your File type is incorrect<br>Enter a .png or .jpg or .jpeg or .gif file type.');
        alert('Enter a .png or .jpg or .jpeg or .gif file type.');
    }

    reader.onloadend = function () {
    // Since it contains the Data URI, we should remove the prefix and keep only Base64 string
    b64 = reader.result.replace(/^data:.+;base64,/, '');
    // console.log(b64); //-> "R0lGODdhAQABAPAAAP8AAAAAACwAAAAAAQABAAACAkQBADs="
    myImage.src = b64dataType + b64;
    console.log(b64);
    };

    var base64 = reader.readAsDataURL(file);

    ClearArray();
    resizeMyImage();

    console.log(myImage);

};
function ClearArray(){
    //clearing image in particles Array if it exists
    try {
        delete particlesArray;
        let particlesArray = [];
    } finally {
        let particlesArray = [];
    }
}
function resizeMyImage(){
    //resizing image to screen h and w
    console.log('this is where we would resize image if it was possible.... ahhhhh');
    // canva.height = myImage.height*2;
    // myImage.width = myImage.width*2;
}





    console.log("1");
    myImage.addEventListener('load',function() {console.log("2");
        const canvas = document.getElementById('canvas1');
        const ctx = canvas.getContext('2d');
        canvas.width = myImage.width*2;
        canvas.height = myImage.height*2;
    
        ctx.drawImage(myImage, 0, 0 ,canvas.width, canvas.height);
        const pixels = ctx.getImageData(0,0,canvas.width,canvas.height);
        ctx.clearRect( 0, 0 ,canvas.width, canvas.height);
        
        particlesArray = [];
        const numberOfParticles = 3000;
        
        let mappedImage = [];
        for(let y = 0; y < canvas.height; y++){
            let row = [];
            for(let x = 0; x < canvas.width; x++ ){
                const red = pixels.data[(y * 4 * pixels.width) + (x * 4)];
                const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
                const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
                const brightness = calculateRelativeBrightness(red, green,blue);
                const cell = [
                    cellBrightness = brightness,
                    cellColor = "rgba("+red+','+green+','+blue+')',
                ];
                row.push(cell);
            }
            mappedImage.push(row);
        }
        function calculateRelativeBrightness(red, green,blue){
            return Math.sqrt(
                (red * red) * 0.299 +
                (green * green) * 0.587 +
                (blue * blue) * 0.114
            )/100;

        }
    
        console.log("3");
        class Particle {
            constructor(){
                this.x = Math.random() * canvas.width;
                this.y = 0;
                this.speed = 0;
                this.velocity = Math.random() * 2;
                this.size = Math.random() * 1.5 + 3;
                this.position1 = Math.floor(this.y);
                this.position2 = Math.floor(this.x);
            }
            update(){
                this.position1 = Math.floor(this.y);
                this.position2 = Math.floor(this.x);
                this.speed = mappedImage[this.position1][this.position2][0];
                let movement = (2.5 - this.speed) + this.velocity;
    
                this.y += movement;
                if(this.y >= canvas.height){
                    this.y = 0;
                    this.x = Math.random() * canvas.width;
                }
            }
            draw(){
                ctx.beginPath();
                ctx.fillStyle = mappedImage[this.position1][this.position2][1];
                ctx.arc(this.x, this.y, this.size, 0 ,Math.PI * 2);
                ctx.fill();
            }
        }
        function init(){
            for(let i = 0; i < numberOfParticles;i++){
                particlesArray.push(new Particle);
            }
        }
        init();
        function animate(){
            //ctx.drawImage(myImage, 0, 0 ,canvas.width, canvas.height);
            ctx.globalAlpha = .05;
            ctx.fillStyle= "rgba(0,0,0,1)"; //original is rgb(0,0,0);
            ctx.fillRect(0,0,canvas.width, canvas.height);
            for(let i = 0; i <particlesArray.length;i++){
                particlesArray[i].update();
                particlesArray[i].draw();
            }
            requestAnimationFrame(animate);
        }
        animate();
    });






